import React, { Component } from 'react';
import { Avatar } from 'antd';
import './Profile.style.scss';

export default class Profile extends Component {
  render() {
    return (
      <div className="profile">
        <div className="profile__main animated bounceIn">
          <div className="profile__main__header">
            <Avatar
              className="profile__main__header__user-avatar"
              size={70}
              src="https://spon.mdp.ac.id/pluginfile.php/1/theme_moove/marketing1icon/1582524735/icon-lecture.png" />
            <div className="profile__main__header__user-info">
              <div className="profile__main__header__user-info__name"><span>Tue Vo</span></div>
              <div className="profile__main__header__user-info__role"><span>Manager</span></div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
